import React from "react";
import BootstrapTable from "react-bootstrap-table-next";

data = [
  {
    id: 0,
    name: "banana",
    price: "0.25"
  },
  {
    id: 1,
    name: "spinach",
    price: "4.49"
  },
  {
    id: 2,
    name: "icecream",
    price: "4.99"
  },
  {
    id: 3,
    name: "bagel",
    price: "1.19"
  },
  {
    id: 4,
    name: "fish",
    price: "10.00"
  }
];

columns = [
  {
    dataField: "id",
    text: "Product ID"
  },
  {
    dataField: "name",
    text: "Product Name"
  },
  {
    dataField: "price",
    text: "Product Price"
  }
];

export default BasicTable = () => {
  return <BootstrapTable keyField="" data={data} columns={columns} />;
};
